    func genPresSimp(subject: Int, verbPos: Int) {
        switch subject {
        case 0:  // I
            gens = "yo \(vn1[verbPos])"
            gene = "I \(vnb[verbPos])"
        case 1:  // You (singular informal)
            gens = "tú \(vn2[verbPos])"
            gene = "you \(vnb[verbPos])"
        case 2:  // He
            gens = "él \(vn3[verbPos])"
            gene = "he \(vnb3[verbPos])"
        case 3:  // She
            gens = "ella \(vn3[verbPos])"
            gene = "she \(vnb3[verbPos])"
        case 4:  // They
            gens = "ellos \(vn4[verbPos])"
            gene = "they \(vnb[verbPos])"
        case 5:  // We
            gens = "nosotros \(vn5[verbPos])"
            gene = "we \(vnb[verbPos])"
        default:
            break
        }
    }
    func genPresSimpAs(subject: Int) {
